                                    "content": ":)))) Mày ngủ trước đi",
                                }
                            }
                            position="right"
                        />
                        <Message
                            message={
                                {
                                    "sender": {
                                        "firstName": "Hacker",
                                        "lastName": "Lỏ",
                                        "avatar": "gaixinh.jpg"
                                    },
                                    "content": "Ngủ đi huhuuuuuuuuuuuuuuuuuuuuuuuuuu",
                                }
                            }
                            position="left"
                        />
                    </div>

                    {/* KHUNG NHAP TIN NHAN */}
                    <div>

